import logo from './logo.svg';
import './App.css';
import map from './components/Map.js';
import markers from './components/Markers.js'

function App() {
  return (
    <div className="App">
      <div className='map'>
        {map()}
      </div>
      <div>
        {markers()}
      </div>
    </div>
  );
}

export default App;
